def solve(tuple, delimiter):
    result = ''
    for element in tuple:
        result += str(element) + delimiter
    return result[:-1]

def solve(tup, delimiter):
    result = ""
    for elem in tup:
        result += str(elem) + str(delimiter)
    result = result[:-1]
    return result

def solve(tup, delim):
    result = ""
    for element in tup:
        result += str(element) + delim
    return result[:-len(delim)]
